import styled from 'styled-components';

export const IntroText = styled.div`
    font-family: Bubble World;
    font-size: max(2.5vw, 25px);
    max-font-size:100px;
    text-align: center;
    top: 30%;
`;

export const RecipeContainer = styled.div<{ left_position: string, top_position:string }>(
    ({left_position, top_position}) =>`
    background-color: red;
    width: 50%;
    height: 50px
`);
